var b="url",c="阳性案例审核.html",d="generationDate",e=new Date(1596795102145.44),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="2d08da31002948df93a3da57a0416018",u="type",v="Axure:Page",w="阳性案例审核",x="notes",y="annotations",z="fn",A="1",B="ownerId",C="fca4ce9f50f14459a916370356fe770f",D="label",E="审核通过",F="说明",G="<p><span>点击操作列中的“审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p><p><span>不允许跨级别审核，跨级别的管理机构看不到其他管理机构下属上报机构的的审核按钮</span></p><p><span><br></span></p>",H="2",I="e6d5949343e4460bb74d21cff6eb7072",J="<p><span>点击操作列中的“审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p><p><span>不允许跨级别审核，跨级别的管理机构看不到其他管理机构下属上报机构的的审核按钮</span></p>",K="3",L="fcceb29469834866b4c0ab69abd3545d",M="退审",N="<p><span>点击操作列中的“退审”，会弹出提框，在弹框中输入“退审原因”，退审原因不允许为空，为必填项，输入后点击“确定”，则数据状态改变为“XXXX（管理账号名称）&nbsp; 已退审”，并显示对应的退审原因，点击“取消”则状态不变；</span></p><p><span>退审的数据，上报账号可以根据退审原因修改，修改后再次上报</span></p>",O="4",P="8a46f553814444db9d88a61a94d3a896",Q="5",R="149801ef2b844c87ad1ec00630be24cc",S="批量审核通过",T="<p><span>点击“批量审核通过”，会弹出提示“是否确定审核通过？”，确定的话则数据状态改变为“XXXX（管理账号名称）&nbsp; 已审核”，取消则状态不变；</span></p>",U="6",V="429e99d97ebf47eea7218f831fbca23f",W="批量退审",X="<p><span>点击“批量退审”，会弹出提框，在弹框中输入“退审原因”，退审原因不允许为空，为必填项，输入后点击“确定”，则数据状态改变为“XXXX（管理账号名称）&nbsp; 已退审”，并显示对应的退审原因，点击“取消”则状态不变；</span></p>",Y="7",Z="591279cfd09741c9a0f12ea23db9f015",ba="所有数据",bb="<p><span>勾选“所有数据”，表示勾选当前列表中的所有可以审核的数据；（注意：下一级管理账号还未审核的数据是不允许选择的，没有复选框）</span></p>",bc="8",bd="e9a64793afe74a8a9b8e224322e99298",be="机构名称",bf="<p><span>机构名称列显示各级管理机构名称和上报机构名称，如果某个管理机构下所有的上报信息（包括直属于这个管理机构的上报账号上报的信息，以及下级管理机构中的上报账号上报的信息）都是已审核，那么需要在这个管理机构旁边显示“已审核”，如果不是所有数据都是已审核，则管理机构旁边不显示内容。</span></p><p><span>复选框代表选中状态，勾选为选中，勾选某个管理机构时，管理机构下所有的上报账号都为选中状态。</span></p>",bg="10",bh="3fa84da0f2234a93ba46f01d2a577dd8",bi="(文本框)",bj="<p><span>默认当天，精确到天置灰，不允许修改。</span></p>",bk="11",bl="3aab06a04b4f4555962ace413a4ab6dd",bm="<p><span>省份、城市、区县，不允许超过管理账号的区域范围</span></p>",bn="12",bo="5473954915d34c50b2332204295ca181",bp="<p><span>针对机构名称模糊匹配查询</span></p>",bq="13",br="204fd9056610442484deb3b5a97e8a0f",bs="(下拉列表)",bt="<p><span>未审核、已审核、已退审，默认为空，为空时表示查询所有状态的数据。</span></p>",bu="14",bv="68cee79d7f194414921f4cc1a7927ef9",bw="<p><span>账号状态是针对管理账号的状态（已审核或者是空）来查询的，默认查询的是“全部数据”，选择“已审核”则只会显示账号状态为“已审核”的数据，选择 空 则显示账号状态为空的数据。</span></p>",bx="15",by="4fbcdaa8fc074637a10f65b28322fe4a",bz="查询",bA="<p><span>查询是触发式，默认刚刚打开页面时，列表都为空，不会进行查询，只有用户点击“查询”按键后，才会查询符合条件的数据。</span></p>",bB="16",bC="d2360cb88f9c4e148e57f9bbd0d67ad3",bD="导出 Excel",bE="<p><span>点击“导出 Excel”，会将当前页面中展示的数据导出到Excel表中。</span></p>",bF="17",bG="9d6e7cf5a8e94a23b16c3136e65513ee",bH="18",bI="e161b6690d214fa88d944c360bc4330d",bJ="19",bK="d9278947eeb840ccb911deb4bcc08f81",bL="20",bM="6b9ca5f34e094ff39cdede3e5b7e5874",bN="21",bO="3e1c5d53f5084cfa8358d95b3c706c50",bP="审核记录",bQ="22",bR="9af2d189404b4092b734c49a5baca769",bS="23",bT="a56c88e720d94c838660e5e9f290004f",bU="24",bV="57a549d2b9714d448bd6e3f3814ed504",bW="style",bX="baseStyle",bY="627587b6038d43cca051c114ac41ad32",bZ="pageAlignment",ca="near",cb="fill",cc="fillType",cd="solid",ce="color",cf=0xFFFFFFFF,cg="image",ch="imageAlignment",ci="imageRepeat",cj="auto",ck="favicon",cl="sketchFactor",cm="0",cn="colorStyle",co="appliedColor",cp="fontName",cq="Applied Font",cr="borderWidth",cs="borderVisibility",ct="borderFill",cu=0xFF797979,cv="cornerRadius",cw="cornerVisibility",cx="outerShadow",cy="on",cz=false,cA="offsetX",cB=5,cC="offsetY",cD="blurRadius",cE="r",cF=0,cG="g",cH="b",cI="a",cJ=0.349019607843137,cK="adaptiveStyles",cL="interactionMap",cM="diagram",cN="objects",cO="id",cP="21a38c41ebbf41d7af4a6d700dea5057",cQ="friendlyType",cR="管理账号后台背景",cS="referenceDiagramObject",cT="styleType",cU="visible",cV=true,cW=1300,cX=900,cY="imageOverrides",cZ="masterId",da="3c0c82fb53ce4cb2a4576c8f5a7ccc77",db="78b18b6e22c147029768bb9b2bafc7a3",dc="矩形",dd="vectorShape",de="'微软雅黑', sans-serif",df="fontWeight",d